    [],nt"num_tags": 2,nt"name": "izembek-national-wildlife-refuge-annual-narrative-report-calendar-year-1994",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Izembek
    National Wildlife Refuge (including Izembek, Pavlof, and Unimak Units) outlines
    Refuge accomplishments during the 1994 calendar year. The report begins with a summary
    of the year's highlights and weather conditions. Land acquisition is covered. The
    report includes a planning section which discusses the master plan, management planning,
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands and wilderness areas. The wildlife section
    of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, marine mammals, fisheries
    resources, scientific collections, marking and bird banding, and disease control.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, trapping, wildlife observation, outdoor recreation, and law enforcement.
    The equipment and facilities section of the report provides information about rehabilitation,
    major maintenance, equipment replacement, communication systems, computer systems,
    and energy conservation. Cooperative programs and items of interest are provided
    at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
